import { Link } from "react-router-dom";

const Navbar = () => {
    return ( 
        <div>
            <nav>
                <ul className="nav">
                    <h1>ToDo List</h1>
                    <Link to ="/">Home</Link>
                    <Link to="/create">New Work</Link>

                </ul>
            </nav>
        </div>
    );
}
 
export default Navbar;
